import styled from "styled-components";

const Hero = styled.h1`
  align-self: center;
  color: #f26c0d;
  font-family: Arial, sans-serif;
  font-weight: 700;
  font-size: 32px;
  margin: 0 auto;

  @media (min-width: 917px) {
    margin: 20px auto;
    font-size: 58px;
  }
`;

export default Hero;
